import React from 'react';
// import { Image } from '../ImageTag/Image';
import Style from '../ProfilePage/Profile.module.css';

export const Profile = ({icon, role, id}) => {
  return (
    <div id={id}>
        <i id={Style.teacherProfile}>{icon}</i>
        <h2>{role}</h2>
    </div>
  )
}
